import React, {useState} from 'react';

const Input = () => {
    const [title, setTitle] = useState("");
    const handleChangeInput = e => setTitle( e.target.value );

    return (
        <div>
            <input
                className="inputText"
                onChange={handleChangeInput}
                placeholder="Please signin"
                value={title}
            />
        </div>
    );
};

export default Input;
